--update
local CURRENTVERSION = "1.3"
local LATESTVERSION = http.Get("https://raw.githubusercontent.com/Hexcheats/Ghostclient/master/version.txt")
local function Update() 
    if CURRENTVERSION ~= LATESTVERSION then
        currentScript = file.Open(GetScriptName(), "w")
        currentScript:Write(http.Get("https://raw.githubusercontent.com/Hexcheats/Ghostclient/master/GhostClient%20V2.lua"))
        currentScript:Close()
        LoadScript(GetScriptName())
    end
end

