function SwitchYaw2()
 if yawtype:GetValue() == 4 then
   if (RotationJitter6 == 10) then
        gui.SetValue("rbot.antiaim.yaw", Value1Yaw:GetValue())
        RotationJitter6 = 11
    elseif (RotationJitter6 == 11) then
        gui.SetValue("rbot.antiaim.yaw", Value2Yaw:GetValue())
        RotationJitter6 = 12
    elseif (RotationJitter6 == 12) then
        gui.SetValue("rbot.antiaim.yaw", Value3Yaw:GetValue())
        RotationJitter6 = 13
    elseif (RotationJitter6 == 13) then
        gui.SetValue("rbot.antiaim.yaw", Value4Yaw:GetValue())
        RotationJitter6 = 10
    
        end
  end
end

