--functions 
local count = 0;
local last = globals.RealTime();

local frame_rate = 0.0
local get_abs_fps = function()
    frame_rate = 0.9 * frame_rate + (1.0 - 0.9) * globals.AbsoluteFrameTime()
    return math.floor((1.0 / frame_rate) + 0.5)
end


local function water()
           draw.Color(35, 35, 35, 255)
           draw.FilledRect(3, 5, 176, 30)
           draw.Color(15, 15, 15, 180)
           draw.FilledRect(8, 10, 170, 25)
           draw.Color(70, 70, 70, 180)
           draw.OutlinedRect(8, 10, 170, 26)
           draw.Color(0, 0, 0, 255)
           draw.OutlinedRect(2, 4, 176, 31)
           draw.Color(70, 70, 70, 180)
           draw.Color(214, 214, 214, 230)
           draw.Text(15, 12, "Ghost")
           draw.Color(159, 202, 43, 230)
           draw.Text(52, 12, "Client") 
           draw.Color(214, 214, 214, 230)
           draw.Text(87, 12, ".net")
           draw.Text(115, 12, "|")
           draw.Text(120, 12, get_abs_fps())
           draw.Text(145, 12, "FPS")
       
end
callbacks.Register( "Draw", water );



